import React, { Component } from 'react'
import './Launch.less'
import Logo from './images/logo.png'
import { Button } from 'antd';

export default class Launch extends Component {
    render() {
        return (
            <div className='launch'>
                <header className='launch-header'>
                    <img src={Logo} alt='logo' />
                    <h1>React后台项目管理系统</h1>
                </header>
                <section className='launch-content'>
                    <span>automate the creation of proxy forms for Mobility Domestic assignments for the US and Officers direct billed expenses which has a payment type of company paid. </span>
                    <div>
                        <Button type="primary">Primary</Button>
                    </div>
                </section>
            </div>
        )
    }
}
